import React from 'react'
import Card from './components/Card'
import * as productList from './productList.json';

const Overview = () => {
    const products = productList.default;

    return (
        <div className="product-overview-page">
            {products.map(function (product, index) {
                if (products[index].isEnabled && products[index].SKU) {
                    return <Card productInfo={products[index]}/>;
                }
            })}
        </div>
    )
}

export default Overview
